import React from "react";
import {
  CarouselProvider,
  Slide,
  Slider,
  ImageWithZoom,
  Dot,
} from "pure-react-carousel";
import "pure-react-carousel/dist/react-carousel.es.css";
import "./SlickCard.css";

const SlickCard = () => {
  return (
    <CarouselProvider
      naturalSlideWidth={200}
      naturalSlideHeight={125}
      totalSlides={3}
      className="row"
    >
      <Slider>
        {/* <Slide index={0}>
          <ImageWithZoom
            style={{ height: "100%" }}
            src="https://i.picsum.photos/id/473/200/300.jpg?hmac=WYG6etF60iOJeGoFVY1hVDMakbBRS32ZDGNkVZhF6-8"
          />
        </Slide> */}
        <Slide index={0}>
          <div className="image-box">
            <ImageWithZoom />
          </div>
        </Slide>
        <Slide index={1}>
          <div className="image-box">
            <ImageWithZoom />
          </div>
        </Slide>
        <Slide index={2}>
          <div className="image-box">
            <ImageWithZoom />
          </div>
        </Slide>
      </Slider>
      <div className="dots col s2">
        <Dot slide={0}>1</Dot>
        <Dot slide={1}>2</Dot>
        <Dot slide={2}>3</Dot>
      </div>
    </CarouselProvider>
  );
};

export default SlickCard;
